const SkillScore = () => {
    return (
        <div className="skillscore">
            <p className="about-title">Skill Score</p>
            <div className="chart-area">
                <canvas id="skillscore-chart"></canvas>
            </div>
        </div>
    );
}

export default SkillScore;
